import React from 'react'
import { theUrl } from 'selfConfig'

const getAdminList = theUrl + '/getAdminList'

const getList = () => {
    const list = []

    fetch(getAdminList)
    .then(res => { return res.json() })
    .then(res => {
        list = res
    })
}

const List = () => {
    getList();


    return(
        <h1>This is list component</h1>
    )
}

export default List;
